(window.webpackJsonp=window.webpackJsonp||[]).push([[89],{310:function(e){e.exports={data:{posts:{totalCount:80,pageInfo:{totalPages:8,currentPage:4,isFirst:!1,isLast:!1},edges:[{node:{title:"When Nice Stuff Happens",image:"/media/images/blog/IMG_20170715_124011.jpg",path:"/blog/2017/07/15/when-nice-stuff-happens",excerpt:"<p>Doesn’t stuff happen? Nice stuff happens. I like it when nice stuff happens.</p>\n",date:"2017-07-15T00:00:00.000Z",timeToRead:2}},{node:{title:"Query the theoretical",image:"/media/images/blog/boom.jpg",path:"/blog/2017/07/11/query-the-theoretical",excerpt:"<p>This will be a bit of thinking out loud, a stream of consciousness. It won’t have the editorial quality that I’m trying to follow, but some strange force is motivating me to put this out before I sleep. It’s just turned 1 am.</p>\n",date:"2017-07-11T00:00:00.000Z",timeToRead:3}},{node:{title:"Oh What a Night?",image:null,path:"/blog/2017/06/30/oh-what-a-night",excerpt:"<p>This is the finish my friend, this is the End.</p>\n",date:"2017-06-30T00:00:00.000Z",timeToRead:1}},{node:{title:"It's Business Time",image:"/media/images/blog/IMG_20170624_153338.jpg",path:"/blog/2017/06/25/it-s-business-time",excerpt:"<p>In my great effort to move forward and get down to business, I got business cards printed.</p>\n",date:"2017-06-25T00:00:00.000Z",timeToRead:1}},{node:{title:"Research report into Name of Austin",image:"/media/images/blog/eggs.png",path:"/blog/2017/06/21/research-report-into-name-of-austin",excerpt:'<h3 id="what-is-austin"><a href="#what-is-austin" aria-hidden="true"><span class="icon icon-link"></span></a>What is Austin?</h3>\n',date:"2017-06-21T00:00:00.000Z",timeToRead:3}},{node:{title:"I have, I want",image:null,path:"/blog/2017/06/16/i-have-i-want",excerpt:"<p>First, I built a splash page profile to help expand my reach as I go into this new world of freelance, casual employment.</p>\n",date:"2017-06-16T00:00:00.000Z",timeToRead:2}},{node:{title:"Public Spoken",image:null,path:"/blog/2017/06/15/public-spoken",excerpt:'<p>I did a presentation with the <a href="https://humanist.nz/" target="_blank" rel="nofollow noopener noreferrer">Humanist Society of New Zealand</a>. About 20 people attended, all in a meeting room above a pub in the middle of the city. I’d say it went well, although I’m sure from an outside perspective I was awkwardly squeezing words out of my mouth.</p>\n',date:"2017-06-15T00:00:00.000Z",timeToRead:2}},{node:{title:"Strange",image:null,path:"/blog/2017/06/07/strange",excerpt:"<p>This is the first time in about 12 years that I haven’t been keeping in the loop around E3. Right now I’m playing through the new Shovel Knight expansion and enjoying the mechanics. I still have a stack of Wii U games to get through including Xenoblade Chronicles X, Twilight Princess HD and Kirby and the Rainbow Paintbrush. I’m sure there’ll be many games announced that I’d like to play, but I’m contempt to play them in the far future. And, despite being largely unemployed right now, I just don’t have the will to play through things as much as I used to.</p>\n",date:"2017-06-07T00:00:00.000Z",timeToRead:1}},{node:{title:"Public Speaking",image:null,path:"/blog/2017/05/30/public-speaking",excerpt:"<p>In my effort to gain human contact, last month I attended the monthly meetup for the Humanist Society of New Zealand. I was apprehensive at first, but it ended up being very enjoyable. I got to have great conversations with intelligent people.</p>\n",date:"2017-05-30T00:00:00.000Z",timeToRead:1}},{node:{title:"Today",image:null,path:"/blog/2017/05/25/today",excerpt:"<p>I feel violently awful today and I don’t know why.</p>\n",date:"2017-05-25T00:00:00.000Z",timeToRead:1}}]}}}}}]);